'''Murphy''' is a sailor who is located at [[Port Khazard]]. To reach him quickly, use the Minigame teleport to [[Fishing Trawler]]. Players must speak to him in the [[Recipe for Disaster]] sub-quest, [[Freeing Pirate Pete|Pirate Pete]], in order to obtain a diving apparatus to go diving. He runs the [[Fishing Trawler]] minigame and also gives players a [[sextant]] which is 1 of 3 items that the [[observatory professor]] tells you is needed to solve a [[coordinate]] in a [[Treasure Trails|Treasure Trail]].


